import { useParams } from "react-router-dom";
import ab from './images/g.jpeg'
import productList from './Home'

function DetailPage() {

    const{id}=useParams();
    

    
    return (

        <div>
            
            <img src={ab} width={100}height={200}/>
            <h1>Detail Page{id}</h1>
        </div>
    )
}

export default DetailPage
